import React from "react";
import { arrowFunctionExpression } from "@babel/types";
import {
    ResponsiveContainer,
    PieChart,
    Tooltip,
    Pie,
    Legend,
    Label
} from "recharts";
export default class NavnTable extends React.Component {
    constructor(props) {
        super(props);
        this.renderlist = this.renderlist.bind(this);
    }

    renderlist() {
        console.log(this.props);
        return (
            <ul id="listview2">
                {this.props.navn.map(navn => (
                    <li key={2}>{navn}</li>
                ))}
            </ul>
        );
    }
    render() {
        let data01 = [];
        console.log(this.props);
        try {
            console.log(this.props.utgifter.length);
            for (let i = 0; i < this.props.utgifter.length; i++) {
                data01.push({
                    name: this.props.utgifter[i].navn,
                    value: this.props.utgifter[i].pris
                });
            }
            for (let item in this.props) {
                console.log(item);
            }
        } catch {
            console.log("heisann");
        }

        try {
            return (
                <div>
                    <PieChart width={400} height={400}>
                        <Pie
                            isAnimationActive={false}
                            data={data01}
                            cx={200}
                            cy={200}
                            outerRadius={80}
                            fill="#8884d8"
                            label
                        />
                        <Tooltip />
                    </PieChart>

                    <Tooltip />
                </div>
            );
        } catch {
            return <p> heii</p>;
        }
    }
}
